import styled from 'styled-components'

const EditDelete = () => {
  const Wrapper = styled.div`
    display: flex;
    flex-direction: row;
    font-size: 16px;
    align-items: center;
    justify-content: center;
    float: right;
    margin-top: -20px;
  `
  return (
    <Wrapper>
      <i class='fa-regular fa-pen-to-square'></i>
      <i class='fa-regular fa-trash-can'></i>
    </Wrapper>
  )
}

export default EditDelete
